import React from 'react';
import './App.css';
import axios from 'axios';

export default class App extends React.Component {
    state = {
        text: "placeholder"
    }

    componentDidMount() {
        axios.get('http://localhost:8080/')
            .then(res => {
                const text = res;
                this.state.text.set({text})
            })
    }
    render() {
        return (
            <div className="App">
              <header className="App-header">
                {this.state.text}
              </header>
            </div>
        )
    }
}
